import React, { useState, useEffect, useRef } from 'react';
import './App.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'; // React Router importlarÄ±
import {
  FaHome,
  FaInbox,
  FaComments,
  FaFileAlt,
  FaChartBar,
  FaClock,
  FaEllipsisH,
  FaGlobe,
  FaEye,
  FaPlus,
} from 'react-icons/fa';

import Sidebar from './components/Sidebar'; // Sidebar bileÅŸeni
import ChatContent from './components/ChatContent'; // ChatContent bileÅŸeni
import Home from './components/Home';
import Inbox from './components/Inbox';
import Chat from './components/Chat';
import Docs from './components/Docs';
import Dashboards from './components/Dashboards';
import Timesheets from './components/Timesheets';
import More from './components/More';
import EverythingPage from './pages/EverythingPage'; // EverythingPage bileÅŸeni
import ListView from './components/ListView'; // Yeni eklenen ListView
import BoardView from './components/BoardView'; // Yeni eklenen BoardView
import GanttView from './components/GanttView'; // Yeni eklenen GanttView
import CalendarView from './components/CalendarView'; // Yeni eklenen CalendarView
import TableView from './components/TableView'; // Yeni eklenen TableView

const App = () => {
  const [activeTab, setActiveTab] = useState('Everything'); // BaÅŸlangÄ±Ã§ta Everything sekmesi aktif
  const [isMenuOpen, setIsMenuOpen] = useState(false); // MenÃ¼ durumu
  const menuRef = useRef(null);

  // SayfanÄ±n herhangi bir yerine tÄ±klanÄ±nca menÃ¼yÃ¼ kapat
  useEffect(() => {
    const handleOutsideClick = (event) => {
      if (menuRef.current && !menuRef.current.contains(event.target)) {
        setIsMenuOpen(false);
      }
    };
    document.addEventListener('mousedown', handleOutsideClick);
    return () => {
      document.removeEventListener('mousedown', handleOutsideClick);
    };
  }, []);

  // Ä°Ã§eriÄŸi seÃ§ilen aktif tab'a gÃ¶re render et
  const renderContent = () => {
    switch (activeTab) {
      case 'Home':
        return <Home />;
      case 'Inbox':
        return <Inbox />;
      case 'Chat':
        return <Chat />;
      case 'Docs':
        return <Docs />;
      case 'Dashboards':
        return <Dashboards />;
      case 'Timesheets':
        return <Timesheets />;
      case 'More':
        return <More />;
      case 'Everything':
        return <EverythingPage />; // EverythingPage'i burada render ediyoruz
      default:
        return <Home />;
    }
  };

  const handleTabClick = (tab) => {
    setActiveTab(tab);
  };

  return (
    <Router>
      <div className="app-container">
        <Sidebar activeTab={activeTab} setActiveTab={setActiveTab} />
        <div className="main-content">
          <div className="top-bar">
            <input type="text" placeholder="Search..." className="search-bar" />
            <div className="top-bar-icons">
              <span title="Notifications">ðŸ””</span>
              <span title="Profile">ðŸ‘¤</span>
            </div>
          </div>
          <div className="content">
            <Switch>
              <Route path="/list" component={ListView} />
              <Route path="/board" component={BoardView} />
              <Route path="/gantt" component={GanttView} />
              <Route path="/calendar" component={CalendarView} />
              <Route path="/table" component={TableView} />
              <Route path="/" exact>
                {renderContent()}
              </Route>
            </Switch>
            <ChatContent activeTab={activeTab} /> {/* ChatContent bileÅŸeni */}
          </div>
        </div>
      </div>
    </Router>
  );
};

export default App;
